    "description": "These sculpture balls are very fun to use. You simply roll them along the clay to produce a pattern or texture that is a little different every time. You can also hold one side of the ball and press the other side into the clay for a round stamped impression. I use no molds, so very single one I make is different. Each is its own little piece of unique artwork. Nobody in the world will have the same sculpture ball as you.\n\nThis listing is for two (2) randomly selected bisque sculpture balls, between 3\/4&quot; and 1 1\/4&quot; in diameter.\n\nI will select the patterns of your stamps at random, but I have added some choices to have a better idea of your taste before I choose for you. PLEASE NOTE: If you wish to select the exact pattern you will receive, you&#39;ll need to purchase one of the Choose Your Own listings found here: https:\/\/www.etsy.com\/shop\/GiselleNo5\/search?search_query=ball\n\nDEPTH OF DESIGN: \n1. Fine Detail - These designs will be shallower and more complex, good for use with stains and light glazes, jewelry making, fine texture.\n-OR-\n2. Deep and Clear - These designs are deep and clear, usually simpler. Best for use with larger pottery items and pooling glazes.\n-OR-\n3. Mix of Both - Often the designs I make are both deep enough for larger pottery items and finely detailed at the same time. \n\nPATTERN PREFERENCES: \n1. Organic Abstract - inspired by nature, this includes fluid lines and forms that resemble plants, flowers, and leaves\n2. Modern Abstract - inspired by architecture, this includes geometric shapes, angles, circles, modern lines and clean design\n3. Stars and Dots - self explanatory, I hope\n4. Spirals and Waves - again, hoping this is self-explanatory\n5. Surprise Me! - I will send you two stamps completely at random. It&#39;s like Russian Roulette, only much safer.\n\nIf you have any questions after reading this listing, please feel free to contact me at any time.\n\nIMPORTANT: By purchasing this listing you agree to the terms of the listing and all shop policies, so please read the full listing and my policies before you buy. \n\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\nSTAMP CARE (all stamps): Keep clean with warm water, mild soap, and a soft brush like an old toothbrush. Clean and rinse between uses and allow to dry thoroughly before the next use. \n\nIMPORTANT: Please purchase separate stamps to use on food and for work with clay. \n\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\nSHORTBREAD DOUGH, FONDANT, AND OTHER FOODS:\nPlease see my other shop, GiselleNo5Handmade.etsy.com for cookie stamps.\n\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\nPOLYMER CLAY? Use:\n&gt; Bisque Stamps\n&gt; Polymer Clay Stamps\nIf the clay sticks to the stamp, either dust with baby powder before stamping or allow the clay to cool before continuing work. \n\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\nSTONEWARE CLAY, EARTHENWARE CLAY, or PORCELAIN CLAY? Use: \n&gt; Bisque Stamps\n&gt; Polymer Clay Stamps\nIf sticking occurs, either lightly dust the stamp with corn starch or lightly oil with olive oil or any other vegetable oil. \n\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\nPRECIOUS METAL CLAY? Use:\n&gt; Polymer Clay Stamps\nIf sticking occurs, lightly oil the stamp. I&#39;ve heard that spray cooking oil works nicely for this purpose. \n\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\nAIR DRY CLAY, PLAY-DOH, PAPER CLAY? Use: \n&gt; Polymer Clay Stamps\n&gt; Bisque Stamps\nIf sticking occurs, use corn starch or baby powder to lightly dust the stamp before each use. \n\nThe dye in Play-Doh will almost certainly stain the stamps, but it will not damage them or affect your future projects as long as you clean the stamps between each use. \n\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\n\nCOPYRIGHT NOTICE: All designs, creative content, descriptions and images are copyright 2012-2015 by Giselle No. 5 - Giselle Massey - whether registered or unregistered. Though my stamps may be used as a tool to create a design on an item that will be sold, I do not permit them to be used to mass manufacture items in factory style production, and making copies of my stamps is strictly prohibited. Violation of this copyright may subject the violator to civil and\/or criminal prosecution. All rights reserved.",
