      "creation_tsz": 1297273255,
      "title": "Designer Prints and Modern Basics",
      "announcement": "Please feel free to contact me for a custom order if you are purchasing multiple items or if you want additional yardage. I can give the lowest possible shipping price for custom orders and am always happy to set up an order especially for you. I also refund significant shipping overages if you purchase multiple listings and the shipping charges come out too high.\r\n\r\nIf you would like to keep updated on shop announcements and new fabrics, either &quot;like&quot; FRESH MODERN FABRIC on Facebook or send an email to freshmodernfabric[AT]gmail.com to be placed on the mailing list.  (I will NEVER share or use your email address for other purposes.)",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": "FRESH MODERN FABRIC will be back on Monday, May 19th, 2014.  I will still be available through Etsy messages and emails if you need to reach me but my response time may be delayed.  Thanks for visiting and please come back to shop when I re-open on May 19th.\r\n",
      "sale_message": "Thank you for purchasing fabric from Fresh Modern Fabric!  I very much appreciate your business.\r\n\r\nIf you would like to keep updated on shop announcements and new fabrics, either &quot;like&quot; FRESH MODERN FABRIC on Facebook or send an email to freshmodernfabric[AT]gmail.com to be placed on the mailing list.  (I will NEVER share or use your email address for other purposes.)\r\n\r\n***INTERNATIONAL CUSTOMERS PLEASE TAKE NOTE***\r\nI cannot be responsible for items lost in the mail.  I try to keep shipping costs down by using first class and priority mail shipping to International addresses.  Unfortunately, these shipping methods do not include shipment tracking and delivery confirmation services to international addresses.  In order to provide these track and confirm services, I need to send your order by registered mail, which I am happy to do at an extra cost.  Please contact me and ask for registered mail shipping if you want protection for items lost in the mail, as I will not otherwise offer refunds or replacements for items lost in the mail.  No exceptions!\r\n\r\nThanks,\r\nAlice",
      "digital_sale_message": null,
      "last_updated_tsz": 1421957686,
      "listing_active_count": 1382,
      "login_name": "FreshModernFabric",
      "accepts_custom_requests": true,
      "policy_welcome": "Welcome to Fresh Modern Fabric!\r\n\r\nFabric shopping makes me really, truly happy.  I strive to make shopping at Fresh Modern Fabric equally joyful for you by offering amazing customer service, competitive pricing, an outstanding selection of designer fabrics and lightning fast shipping.\r\n\r\nI am always happy to set up a custom listing for you with different fabric quantities or individualized combinations of any of the products I carry...just contact me through the link on the left sidebar!",
      "policy_payment": "I accept PayPal for payment.  You can pay by credit card with PayPal and you do not even need to set up a PayPal account.\r\n\r\nAn Ohio state sales tax of 6.5% will be charged to all orders shipped to an Ohio address.",
      "policy_shipping": "I will happily combine shipping and I also refund significant shipping overcharges.  If you need any special shipping options, such as expedited shipping, registered mail, insurance or anything else, please contact me before purchasing so that I can make the necessary adjustments to your order.\r\n\r\nI ship through USPS and I ship fast!  I am located right across the street from the post office and make multiple trips there a day.\r\n\r\n***INTERNATIONAL CUSTOMERS PLEASE TAKE NOTE***\r\n\r\nCustoms forms will always state the full amount paid for the merchandise (not including shipping charges). Customs duties may apply upon receipt and are the responsibility of the customer. Customs taxes and rules vary by location, so please consult your local jurisdiction for more information on additional customs taxes that may apply.\r\n\r\nI cannot be responsible for items lost in the mail.  I try to keep shipping costs down by using first class and priority mail shipping to International addresses.  Unfortunately, these shipping methods do not include shipment tracking and delivery confirmation services to international addresses.  In order to provide these track and confirm services, I need to send your order by registered mail, which I am happy to do at an extra cost.  Please ask me to add registered mail shipping to your order if you want protection for items lost in the mail, as I will not otherwise offer refunds or replacements for items lost in the mail.  No exceptions!",
      "policy_refunds": "I know it can often be difficult to buy fabric online.  The last thing I want is for you to be dissatisified with your purchase once it arrives on your doorstep!  If you are unhappy with your fabric for any reason, please contact me right away.  I will happily replace damaged or flawed fabrics.  While I cannot offer refunds on cut to order fabrics, I am willing to offer an exchange on regularly priced fabrics within 14 days of purchase.  I cannot exchange or refund sale fabrics.  The customer is responsible for original and return shipping costs for exchanges, unless I am at fault for sending the wrong item.",
      "policy_additional": null,
      "policy_seller_info": null,
      "policy_updated_tsz": 1385236091,
      "vacation_autoreply": "FRESH MODERN FABRIC  is closed until Monday, May 19th, 2014.  I&#39;m still checking messages and emails, however, so will try to get back to you as soon as possible.\r\n\r\nThanks!\r\nAlice",
